import {AppBar,Toolbar,styled} from '@mui/material';

const Header=styled(AppBar)
`
background: #111111;
`;

const Taps=styled(Toolbar)
`
font-size:bold;
margin-right: 40px;
`;

const Navbar=()=>{
    return (
       <Header>
        <Taps>
            <p>Home</p>
            <p>All User</p>
            <p>Add User</p>
        </Taps>
       </Header>
    )
}

export default Navbar;
